import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card'

const useStyles = makeStyles(theme => ({
  root: { display: 'flex', padding: '10px 20px', justifyContent: 'space-between' },
  image: { width: '30px' }
}));

const AddDatasource = ({ type, modal }) => {
  const classes = useStyles();

  return (
    <Card className={classes.root}>
      <div>
        MongoDB
      </div>
      <div>
        <img className={classes.image} src={require('../../static/db_mongodb.png')} />
      </div>
    </Card>
  )
}


export default AddDatasource;
